%[text] ## Predictor importance
clear
load("RF_2019.mat");
load('RF_2021.mat');
load('RF_2021_red.mat');
load("tbl_2019.mat");
load("tbl_2021.mat");

%%
modeli = {mdl_2019, mdl_2021, mdl_2021_red};
godine = ["2019", "2021", "2021 redukovan"];
for i = 1:length(modeli) %[output:group:2bf90aa9]
    model = modeli{i};
    imp = predictorImportance(model);
    figure %[output:0049f854] %[output:0744088d] %[output:47411ab2]
    bar(imp); %[output:0049f854] %[output:0744088d] %[output:47411ab2]
    xticklabels(model.PredictorNames)
    xtickangle(45);
    title('Znacaj prediktora za Random Forest Model ' + godine(i));
end %[output:group:2bf90aa9]

%%
%[text] ## ICE plots
for i = 1:length(modeli) %[output:group:65c01877]
    model = modeli{i};
    imp = predictorImportance(model);
    [~, idx] = maxk(imp, 3);
    topPredictors = model.PredictorNames(idx);
    
    figure; %[output:39807294] %[output:9b3dfa5e] %[output:029ba84a]
   
    for j = 1:length(topPredictors)
        subplot(1,3, j); %[output:39807294] %[output:9b3dfa5e] %[output:029ba84a]
        plotPartialDependence(model, topPredictors(j), Conditional="centered");
        title("Uticaj " + topPredictors(j) + " na m/r")
        xlabel(topPredictors(j));
        ylabel('m/r');
    end
    sgtitle("ICE + PDP — RF model " + godine(i));
end %[output:group:65c01877]


%%
m_2021_red = normalize(tbl_2021{:, 2:end-1});
[PD, X1, X2] = partialDependence(mdl_2021_red, {'starost_PC1', 'ON'}, m_2021_red); %[output:9b1fd440] %[output:089a0407] %[output:392a0ee1]

%%
%[text] ## Surf

figure %[output:5203ee82]
surf(X1, X2,PD) %[output:5203ee82]
xlabel('starost\_PC1') %[output:5203ee82]
ylabel('ON') %[output:5203ee82]
zlabel('Predviđeni mr') %[output:5203ee82]
title('Uticaj starost\_PC1 i ON na mr (RF 2021 redukovan)') %[output:5203ee82]
colormap turbo         %[output:5203ee82]
colorbar               %[output:5203ee82]
shading interp       %[output:5203ee82]
grid on; box on; %[output:5203ee82]

%%
%[text] ## Heatmap

figure %[output:69217d4d]
imagesc(X1, X2, PD) %[output:69217d4d]
xlabel('starost\_PC1') %[output:69217d4d]
ylabel('ON') %[output:69217d4d]
colormap(flipud(redbluecmap)) %[output:69217d4d]
colorbar %[output:69217d4d]


